import React from 'react';
import '../../Styles/Navbar.css';
import AppLogo from '../../Images/app-logo.png';
import BurgerIcon from './BurgerIcon';

const Navbar = (props) => {
  return (
    <header className='navbar'>
      <div className='navbar_'>
        <button className='navbar_icon_button' onClick={props.sidebarDetails.toggleSidebar}>
          <BurgerIcon />
        </button>
        <a className='navbar_app_logo' href='/' onClick={props.sidebarDetails.toggleSidebar}>
            <img src={AppLogo} alt="App Logo"/>
        </a>
      </div>
      <button className='navbar_icon_button' onClick={props.toggleTheme}>
        <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor">
          <path stroke-linecap="round" stroke-linejoin="round" d="M12 3v2.25m6.364.386-1.591 1.591M21 12h-2.25m-.386 6.364-1.591-1.591M12 18.75V21m-4.773-4.227-1.591 1.591M5.25 12H3m4.227-4.773L5.636 5.636M15.75 12a3.75 3.75 0 1 1-7.5 0 3.75 3.75 0 0 1 7.5 0Z" />
        </svg>
      </button>
    </header>
  );
};

export default Navbar;
